import React, { useState } from 'react';

const FormPopup = () => {
  const [isOpen, setIsOpen] = useState(false);
  const [submissions, setSubmissions] = useState([]);
  const [formData, setFormData] = useState({
    Title: '',
    email: '',
    message: ''
  });

  const handleSubmit = (e) => {
    e.preventDefault();
    setSubmissions([...submissions, { ...formData, id: Date.now() }]);
    setFormData({ Title: '', email: '', message: '' });
    setIsOpen(false);
  };

  const handleChange = (e) => {
    const { Title, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [Title]: value
    }));
  };

  const modalStyles = {
    overlay: {
      display: isOpen ? 'flex' : 'none',
      position: 'fixed',
      top: 0,
      left: 0,
      right: 0,
      bottom: 0,
      backgroundColor: 'rgba(0, 0, 0, 0.5)',
      justifyContent: 'center',
      alignItems: 'center',
      zIndex: 1000
    },
    modal: {
      backgroundColor: 'white',
      padding: '20px',
      borderRadius: '8px',
      maxWidth: '500px',
      width: '90%'
    },
    input: {
      width: '100%',
      padding: '8px',
      marginTop: '4px',
      marginBottom: '16px',
      border: '1px solid #ccc',
      borderRadius: '4px'
    },
    button: {
      padding: '8px 16px',
      backgroundColor: '#007bff',
      color: 'white',
      border: 'none',
      borderRadius: '4px',
      cursor: 'pointer'
    },
    card: {
      border: '1px solid #ccc',
      borderRadius: '4px',
      padding: '16px',
      marginBottom: '16px'
    }
  };

  return (
    <div>
      <button 
        onClick={() => setIsOpen(true)}
        style={modalStyles.button}
      >
        Open Form
      </button>

      <div style={modalStyles.overlay}>
        <div style={modalStyles.modal}>
          <h2 style={{ marginBottom: '20px' }}>Submit Information</h2>
          <form onSubmit={handleSubmit}>
            <div>
              <label htmlFor="name">Name</label>
              <input
                id="name"
                name="name"
                value={formData.name}
                onChange={handleChange}
                required
                style={modalStyles.input}
              />
            </div>
            <div>
              <label htmlFor="email">Email</label>
              <input
                id="email"
                name="email"
                type="email"
                value={formData.email}
                onChange={handleChange}
                required
                style={modalStyles.input}
              />
            </div>
            <div>
              <label htmlFor="message">Message</label>
              <input
                id="message"
                name="message"
                value={formData.message}
                onChange={handleChange}
                required
                style={modalStyles.input}
              />
            </div>
            <div style={{ display: 'flex', gap: '10px', justifyContent: 'flex-end' }}>
              <button 
                type="button" 
                onClick={() => setIsOpen(false)}
                style={{ ...modalStyles.button, backgroundColor: '#6c757d' }}
              >
                Cancel
              </button>
              <button 
                type="submit"
                style={modalStyles.button}
              >
                Submit
              </button>
            </div>
          </form>
        </div>
      </div>

      {/* Display submitted information */}
      <div style={{ marginTop: '32px' }}>
        <h2 style={{ marginBottom: '16px' }}>Submitted Information</h2>
        {submissions.map(submission => (
          <div key={submission.id} style={modalStyles.card}>
            <p><strong>Name:</strong> {submission.name}</p>
            <p><strong>Email:</strong> {submission.email}</p>
            <p><strong>Message:</strong> {submission.message}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default FormPopup;
